INSERT INTO `tb_activities` VALUES (2, '镜观天下摄影大赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>镜观天下摄影比赛公告</strong></span></p><p style=\"text-align: start;\">尊敬的摄影爱好者们，</p><p style=\"text-align: start;\">镜观天下摄影协会自豪地宣布，我们将举办一场精彩绝伦的摄影比赛，名为“镜观天下摄影比赛”。这是一个展示你们摄影才华的绝佳机会，让我们一起用镜头捕捉世界的美好，留下永恒的记忆！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 镜观天下摄影比赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 镜观天下摄影协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛主题：</strong></span></p><p style=\"text-align: start;\">我们鼓励参赛者以创意十足的方式表达以下主题之一：</p><ol><li style=\"text-align: start;\">自然之美：展示大自然的壮丽景色，捕捉自然界的奇妙与神奇。</li><li style=\"text-align: start;\">人文风情：通过镜头记录人类生活的各个方面，传达人类情感与文化的多样性。</li><li style=\"text-align: start;\">艺术创新：展示摄影艺术的创新与突破，让观众眼前一亮。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛规则：</strong></span></p><ol><li style=\"text-align: start;\">比赛开放给所有摄影爱好者，无论职业或业余。</li><li style=\"text-align: start;\">参赛作品必须是原创作品，未曾在其他比赛或平台上发表过。</li><li style=\"text-align: start;\">每位参赛者最多可提交三幅作品。</li><li style=\"text-align: start;\">提交的照片应当符合比赛主题，并且清晰、高质量。</li><li style=\"text-align: start;\">请在照片附上简短的说明，介绍照片背后的故事或意义。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>参赛方式：</strong></span></p><p style=\"text-align: start;\">请将参赛作品发送至比赛邮箱：<a href=\"\" target=\"_new\">photocompetition@mirrorworld.com</a>，并在邮件主题中注明“镜观天下摄影比赛参赛作品”。邮件正文中请提供以下信息：</p><ul><li style=\"text-align: start;\">姓名</li><li style=\"text-align: start;\">联系方式（电话号码、邮箱等）</li><li style=\"text-align: start;\">摄影作品名称</li><li style=\"text-align: start;\">摄影作品说明</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>截止日期：</strong></span> [2024年5月6日]</p><p style=\"text-align: start;\">我们期待着收到你们精彩的作品！参与镜观天下摄影比赛，展示你的摄影天赋，让世界为你的视角倾倒！</p><p style=\"text-align: start;\">如有任何疑问，请联系我们：[联系方式]</p><p style=\"text-align: start;\">镜观天下摄影协会 敬上</p>', 2, '2024-03-06 00:00:00', '2024-04-05 00:00:00', '线上比赛', '/activityUploads/a067d44123d99e786fd014e1f70d32e6', '', '/5120200001,4/5120200002,3');
INSERT INTO `tb_activities` VALUES (3, '无畏契约挑战赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>无畏契约电子竞技挑战赛公告</strong></span></p><p style=\"text-align: start;\">尊敬的电竞爱好者们，</p><p style=\"text-align: start;\">电子竞技协会自豪地宣布，我们将举办一场激动人心的电子竞技挑战赛，名为“无畏契约挑战赛”。这将是一场汇聚顶尖玩家、展示技艺的盛大赛事，让我们共同见证电竞的独特魅力，共享激情与荣耀！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 无畏契约挑战赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 电子竞技协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛项目：</strong></span></p><p style=\"text-align: start;\">本次挑战赛将专注于热门游戏《无畏契约》。《无畏契约》是一款多人在线竞技游戏，融合了策略、操作和团队合作，是电竞领域备受瞩目的游戏之一。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">我们将设置多种比赛形式，包括个人赛、团队赛等，以及多种比赛模式，如排位赛、淘汰赛等，以满足不同玩家的参赛需求。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的精湛技艺和出色表现，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军奖金</li><li style=\"text-align: start;\">亚军奖金</li><li style=\"text-align: start;\">季军奖金</li><li style=\"text-align: start;\">最佳表现奖</li><li style=\"text-align: start;\">最有潜力奖</li><li style=\"text-align: start;\">最具创意奖</li><li style=\"text-align: start;\">最佳团队奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 开始，持续 [比赛持续时间]，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">玩家们可以通过电子竞技协会官方网站或者在校园内指定地点进行线下报名。报名时间将在稍后公布，请密切关注我们的通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">电子竞技协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">电子竞技协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">电子竞技协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">电子竞技协会期待着您的参与！让我们一起在“无畏契约挑战赛”中创造辉煌，书写电竞传奇！</p><p style=\"text-align: start;\">电子竞技协会 敬上</p>', 7, '2024-04-05 00:11:48', '2024-04-12 00:00:00', '西南科技大学新区外竞尚网咖', '/activityUploads/663f042c561aa4061ee545593bafb536', '无畏契约挑战赛活动详情.docx /activityUploads/ab1e297481004fd3f71d4ad47a9e1366', '/5120200001,5/5120200002,5');
INSERT INTO `tb_activities` VALUES (4, '街舞大赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>街舞大赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的街舞爱好者们，</p><p style=\"text-align: start;\">Douth街舞协会荣幸地宣布，我们将举办一场精彩绝伦的街舞大赛！作为一场独具魅力的文化盛宴，我们诚邀您参与，共同探索舞蹈的无限可能性，展现青春的活力与激情！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 街舞大赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> Douth街舞协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛项目：</strong></span></p><p style=\"text-align: start;\">我们将设立多个舞蹈项目，包括但不限于：</p><ol><li style=\"text-align: start;\">个人freestyle</li><li style=\"text-align: start;\">团队battle</li><li style=\"text-align: start;\">街舞风格赛</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">比赛将以实力赛为主，采用单人或团队赛制，通过创新、技术和表演力量来竞争，展现出每位舞者的个人魅力和团队默契。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的出色表现和才华横溢，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军奖金</li><li style=\"text-align: start;\">亚军奖金</li><li style=\"text-align: start;\">季军奖金</li><li style=\"text-align: start;\">最佳表现奖</li><li style=\"text-align: start;\">最佳编舞奖</li><li style=\"text-align: start;\">最具创意奖</li><li style=\"text-align: start;\">最佳团队奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请参赛者通过Douth街舞协会官方网站或线下指定地点进行报名。报名截止时间为 [报名截止时间]，请及时报名。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">Douth街舞协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">Douth街舞协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">Douth街舞协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同燃起舞蹈的激情，挥洒青春的活力，在街舞大赛的舞台上展现出最炫酷的舞姿！期待您的参与！</p><p style=\"text-align: start;\">Douth街舞协会 敬上</p>', 32, '2024-04-23 00:00:00', '2024-04-24 00:00:00', '西南科技大学龙山体育场', '/activityUploads/9a5c6a803664d3d22fddd4381edb1d4b', '街舞大赛详情.docx /activityUploads/eaddd21721eea695295e10308380dae8', '/5120200001,4');
INSERT INTO `tb_activities` VALUES (5, '民族器乐演奏比赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>民族器乐演奏比赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的音乐艺术爱好者们，</p><p style=\"text-align: start;\">宫羽民族器乐协会荣幸地宣布，我们将举办一场别开生面的民族器乐演奏比赛！这将是一次展现才华、交流学习的难得机会，让我们共同领略音乐的魅力，感受民族器乐的美妙之处！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 民族器乐演奏比赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 宫羽民族器乐协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛项目：</strong></span></p><p style=\"text-align: start;\">本次比赛将涵盖多种民族器乐演奏项目，包括但不限于：</p><ol><li style=\"text-align: start;\">箫演奏</li><li style=\"text-align: start;\">古筝演奏</li><li style=\"text-align: start;\">葫芦丝演奏</li><li style=\"text-align: start;\">笛子演奏</li><li style=\"text-align: start;\">扬琴演奏</li><li style=\"text-align: start;\">贝斯演奏</li><li style=\"text-align: start;\">等等</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">比赛将以独奏、合奏、即兴演奏等形式进行，旨在展现选手们的个人技艺、团队合作能力以及创造力。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的才华和努力，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">金奖</li><li style=\"text-align: start;\">银奖</li><li style=\"text-align: start;\">铜奖</li><li style=\"text-align: start;\">优秀表现奖</li><li style=\"text-align: start;\">最具潜力奖</li><li style=\"text-align: start;\">最佳编曲奖</li><li style=\"text-align: start;\">最佳团队奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">参赛者可通过宫羽民族器乐协会官方网站或线下指定地点进行报名。报名截止时间为 [报名截止时间]，请提前报名，以免错过参赛机会。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">宫羽民族器乐协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">宫羽民族器乐协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">宫羽民族器乐协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同投身音乐的海洋，奏响心中的旋律，共同探索民族器乐的美妙世界！期待您的参与！</p><p style=\"text-align: start;\">宫羽民族器乐协会 敬上</p>', 9, '2024-05-13 00:00:00', '2024-05-14 00:00:00', '西南科技大学演奏厅', '/activityUploads/93b18fc8261cb135a3055c2f696a9d93', '', '/5120200001,3/5120200002,3');
INSERT INTO `tb_activities` VALUES (6, '汉服文化节', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>汉服文化节通知</strong></span></p><p style=\"text-align: start;\">亲爱的汉服文化爱好者们，</p><p style=\"text-align: start;\">含章汉文化协会欣喜地宣布，我们将举办一场精彩绝伦的汉服文化节！这将是一场弘扬传统、传承文化的盛会，让我们共同感受汉服之美，领略传统文化的魅力！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>活动详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>活动名称：</strong></span> 汉服文化节</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 含章汉文化协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>活动内容：</strong></span></p><p style=\"text-align: start;\">本次汉服文化节将包含丰富多彩的活动内容，包括但不限于：</p><ol><li style=\"text-align: start;\">汉服展示：展示精美的汉服和配饰，让人们领略汉服之美；</li><li style=\"text-align: start;\">汉服讲座：邀请专家学者为大家解读汉服文化的历史背景和内涵；</li><li style=\"text-align: start;\">汉服走秀：举办汉服走秀活动，展示不同款式和风格的汉服；</li><li style=\"text-align: start;\">汉服体验：为参与者提供汉服穿着体验，让每个人都能感受到汉服的魅力；</li><li style=\"text-align: start;\">汉服摄影：为喜爱汉服的摄影爱好者提供拍摄机会，留下美好的回忆。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>活动时间：</strong></span></p><p style=\"text-align: start;\">汉服文化节将于 [活动时间] 在 [活动地点] 举行，具体活动安排将稍后公布，请密切关注我们的通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">欢迎各位汉服爱好者参与本次活动！报名方式将在稍后公布，请留意我们的官方网站和社交媒体平台。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">含章汉文化协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">含章汉文化协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">含章汉文化协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同穿上汉服，走进传统文化的世界，共同探索汉服文化的无限魅力！期待您的参与！</p><p style=\"text-align: start;\">含章汉文化协会 敬上</p>', 11, '2024-04-11 00:00:00', '2024-04-17 19:26:37', '西南科技大学', '/activityUploads/bf18d0998ccccb39b7b9ba8480c7736d', '汉服文化节详情.docx /activityUploads/fffdf62dcd9b99077119b7266176378f', '/5120200002,4/5120200001,2');
INSERT INTO `tb_activities` VALUES (7, '\"FREE TALK\"英语演讲比赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>FREE TALK 英语演讲比赛通知</strong></span></p><p style=\"text-align: start;\">亲爱的英语爱好者们，</p><p style=\"text-align: start;\">英语协会荣幸地宣布，我们将举办一场激动人心的英语演讲比赛，名为“FREE TALK”。这将是一个展示口才、分享观点的绝佳机会，让我们共同感受英语的魅力，发表自己的声音，畅谈心中所思所想！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> FREE TALK 英语演讲比赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 英语协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛主题：</strong></span></p><p style=\"text-align: start;\">本次比赛主题开放，选手可根据自己的兴趣、经验或感悟选择演讲内容，自由发挥，话题不限。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">比赛将采用个人演讲形式，每位选手将有一定的时间在舞台上自由发表演讲，展示口才和表达能力。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>评审标准：</strong></span></p><p style=\"text-align: start;\">演讲内容的创意性、深度、逻辑性和表达能力将作为评审的主要标准。同时，选手的发音、语调、语速等语言技巧也将被考量。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的出色表现和才华横溢，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军奖金</li><li style=\"text-align: start;\">亚军奖金</li><li style=\"text-align: start;\">季军奖金</li><li style=\"text-align: start;\">最佳演讲奖</li><li style=\"text-align: start;\">最佳口才奖</li><li style=\"text-align: start;\">最佳观点奖</li><li style=\"text-align: start;\">最佳表达奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参赛的同学提前报名。报名方式将在稍后公布，请关注我们的官方通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">英语协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">英语协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">英语协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同展现英语的魅力，畅谈心中所思所想，在FREE TALK英语演讲比赛的舞台上尽情发挥！期待您的参与！</p><p style=\"text-align: start;\">英语协会 敬上</p>', 18, '2024-04-24 10:47:58', '2024-04-24 22:58:59', '西南科技大学东八演播大厅', '/activityUploads/b9b75f462bc1cda9b51816ba07321db5', '', '/5120200001,4/5120200002,2');
INSERT INTO `tb_activities` VALUES (8, '西科杯羽毛球赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>西科杯羽毛球赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的羽毛球运动爱好者们，</p><p style=\"text-align: start;\">我们很高兴地宣布，羽毛球协会将举办一场备受期待的羽毛球赛事——西科杯羽毛球赛！这将是一场激烈竞争、精彩纷呈的赛事，让我们共同展现羽毛球的技艺，享受运动的乐趣！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 西科杯羽毛球赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 羽毛球协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛项目：</strong></span></p><p style=\"text-align: start;\">本次比赛将设置多个羽毛球项目，包括但不限于：</p><ol><li style=\"text-align: start;\">男子单打</li><li style=\"text-align: start;\">女子单打</li><li style=\"text-align: start;\">男子双打</li><li style=\"text-align: start;\">女子双打</li><li style=\"text-align: start;\">混合双打</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">比赛将采用单淘汰赛制，采用21分制（每局先达到21分者获胜，如21-20则继续比赛，直至某方获得两分优势）。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的努力和表现，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军奖杯及奖金</li><li style=\"text-align: start;\">亚军奖杯及奖金</li><li style=\"text-align: start;\">季军奖杯及奖金</li><li style=\"text-align: start;\">最佳球员奖</li><li style=\"text-align: start;\">最佳团队奖</li><li style=\"text-align: start;\">最佳新秀奖</li><li style=\"text-align: start;\">最佳精神奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请各位运动员在指定时间内通过羽毛球协会官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">羽毛球协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">羽毛球协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">羽毛球协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一起迎接挑战，挥洒汗水，为西科杯羽毛球赛而奋斗！期待您的参与！</p><p style=\"text-align: start;\">羽毛球协会 敬上</p>', 29, '2024-05-17 00:00:00', '2024-05-19 00:00:00', '西南科技大学新区体育馆羽毛球馆', '/activityUploads/7cf60e444c378a2cb2dc2dc0fca79473', '', '/5120200001,4/5120200002,2');
INSERT INTO `tb_activities` VALUES (9, '西南科技大学第七届数学建模大赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>西南科技大学第七届数学建模比赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的同学们，</p><p style=\"text-align: start;\">我们荣幸地宣布，数学建模协会将举办西南科技大学第七届数学建模比赛！这是一个展现数学才华、锻炼思维能力的绝佳机会，让我们一起投入到数学的海洋中，共同探索问题的解决之道！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 西南科技大学第七届数学建模比赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 数学建模协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">本次比赛将分为两个阶段进行：</p><ol><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>初赛：</strong></span> 初赛将于 [初赛时间] 举行，参赛队伍将根据指定的题目在规定时间内完成建模和分析工作。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>决赛：</strong></span> 决赛将于 [决赛时间] 举行，入围的队伍将在决赛中展示他们的成果，并与其他队伍竞争最终的奖项。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛主题：</strong></span></p><p style=\"text-align: start;\">比赛的主题将根据实际情况确定，具体题目将在比赛开始前公布。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀队伍的努力和创新，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军奖金及证书</li><li style=\"text-align: start;\">亚军奖金及证书</li><li style=\"text-align: start;\">季军奖金及证书</li><li style=\"text-align: start;\">最佳创新奖</li><li style=\"text-align: start;\">最佳分析奖</li><li style=\"text-align: start;\">最佳团队协作奖</li><li style=\"text-align: start;\">最佳展示奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请各位同学在指定时间内通过数学建模协会官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">数学建模协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">数学建模协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">数学建模协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一起投入到数学建模的世界中，挑战自我，追求卓越！期待您的参与！</p><p style=\"text-align: start;\">数学建模协会 敬上</p>', 52, '2024-05-01 00:00:00', '2024-05-21 00:00:00', '线上比赛', '/activityUploads/35cded73b3f75b396c074d392e9d429a', '数学建模比赛比赛安排.docx /activityUploads/6b017b1772cb3ee4e34154e068bb6f02', '/5120200001,4/5120200002,2');
INSERT INTO `tb_activities` VALUES (10, '“胜你半子”围棋比赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>胜天半子围棋比赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的围棋爱好者们，</p><p style=\"text-align: start;\">大众棋社荣幸地宣布，我们将举办一场激动人心的围棋比赛——胜天半子围棋比赛！这是一个展现围棋技艺、切磋棋艺的盛会，让我们共同走进围棋的世界，切磋棋艺，交流心得！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 胜天半子围棋比赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 大众棋社</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">本次比赛采用个人赛制，采用瑞士轮制度，每局对弈时间根据比赛轮次确定。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛项目：</strong></span></p><p style=\"text-align: start;\">比赛分为业余组和职业组，比赛项目包括：</p><ol><li style=\"text-align: start;\">业余组个人赛</li><li style=\"text-align: start;\">职业组个人赛</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的棋艺和努力，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">业余组冠军、亚军、季军奖金及证书</li><li style=\"text-align: start;\">职业组冠军、亚军、季军奖金及证书</li><li style=\"text-align: start;\">最佳棋风奖</li><li style=\"text-align: start;\">最佳新秀奖</li><li style=\"text-align: start;\">最佳团队奖（若有团队报名）</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参赛的同学在指定时间内通过大众棋社官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">大众棋社官方网站：[官方网站链接]</li><li style=\"text-align: start;\">大众棋社联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">大众棋社联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同燃起围棋的热情，挥洒汗水，为胜天半子围棋比赛而奋斗！期待您的参与！</p><p style=\"text-align: start;\">大众棋社 敬上</p>', 55, '2024-05-26 00:00:00', '2024-05-26 23:38:13', '西南科技大学西101', '/activityUploads/adec01b68e6561d9eeef72f096ee6785', '围棋比赛文件.docx /activityUploads/df456e13a3a867244b09a3147fd7138e', '/5120200001,4/5120200002,2');
INSERT INTO `tb_activities` VALUES (11, '金融挑战赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>金融挑战赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的投资金融爱好者们，</p><p style=\"text-align: start;\">风云投资协会荣幸地宣布，我们将举办一场激动人心的金融挑战赛！这将是一个展现金融智慧、锻炼投资技巧的绝佳机会，让我们共同探索金融市场的风云变幻，挑战自我，成就梦想！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 金融挑战赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 风云投资协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">本次比赛分为以下几个环节：</p><ol><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>资产配置竞赛：</strong></span> 参赛队伍将根据指定的投资组合，进行资产配置和风险管理，在规定时间内取得最佳收益。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>投资策略大赛：</strong></span> 参赛队伍将提出自己的投资策略，并在实盘模拟环境下执行，以获得最高的投资回报。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>投资案例分析：</strong></span> 参赛队伍将分析指定的投资案例，并提出解决方案和投资建议。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的投资智慧和表现，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军奖金及证书</li><li style=\"text-align: start;\">亚军奖金及证书</li><li style=\"text-align: start;\">季军奖金及证书</li><li style=\"text-align: start;\">最佳投资组合奖</li><li style=\"text-align: start;\">最佳投资策略奖</li><li style=\"text-align: start;\">最佳分析奖</li><li style=\"text-align: start;\">最佳团队协作奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参赛的同学在指定时间内通过风云投资协会官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">风云投资协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">风云投资协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">风云投资协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同迎接金融挑战，探索投资之道，成就自我，成就未来！期待您的参与！</p><p style=\"text-align: start;\">风云投资协会 敬上</p>', 57, '2024-05-01 00:00:00', '2024-06-01 00:00:00', '线上比赛', '/activityUploads/6eb26736839447aa4e574f8f33f04af1', '金融挑战赛比赛规则.docx /activityUploads/5179b194e5fb1a43ef64d13ae36769a0', '/5120200001,4/5120200002,2');
INSERT INTO `tb_activities` VALUES (12, '绿色骑行活动', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>绿色骑行活动通知</strong></span></p><p style=\"text-align: start;\">亲爱的骑行爱好者们，</p><p style=\"text-align: start;\">i7单车协会荣幸地宣布，我们将举办一场绿色骑行活动！这将是一个环保健康的骑行盛会，让我们骑上单车，畅游自然，共同倡导绿色出行，保护环境！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>活动详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>活动名称：</strong></span> 绿色骑行活动</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> i7单车协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>活动内容：</strong></span></p><p style=\"text-align: start;\">本次绿色骑行活动将带您领略城市风光，呼吸新鲜空气，共同享受骑行的乐趣。活动包括但不限于：</p><ol><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>绿色骑行路线：</strong></span> 我们将规划出一条美丽的骑行路线，沿途欣赏城市风景和自然景观。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>环保宣传：</strong></span> 活动中将开展环保宣传活动，倡导绿色出行，减少碳排放，保护环境。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>骑行分享：</strong></span> 参与者可以分享自己的骑行经历和心得，交流骑行技巧，增进友谊。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>活动时间：</strong></span></p><p style=\"text-align: start;\">绿色骑行活动将于 [活动时间] 在 [活动地点] 举行，具体活动时间和集合地点将另行通知，请密切关注我们的通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参加活动的朋友在指定时间内通过i7单车协会官方网站或线下报名点报名参加。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">i7单车协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">i7单车协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">i7单车协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同骑行，感受自然，传递绿色，共享健康！期待您的参与！</p><p style=\"text-align: start;\">i7单车协会 敬上</p>', 69, '2024-05-12 00:00:00', '2024-05-12 18:08:30', '西南科技大学', '/activityUploads/f93916c9008adf828f693810157c022e', '', '/5120200001,4/5120200002,2');
INSERT INTO `tb_activities` VALUES (13, '“SHOW真的”滑板比赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>SHOW真的滑板比赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的滑板爱好者们，</p><p style=\"text-align: start;\">New Board滑板协会荣幸地宣布，我们将举办一场震撼人心的真的滑板比赛——SHOW真的滑板比赛！这将是一个炫技比拼、展示风采的绝佳机会，让我们一起挑战极限，展现滑板的魅力！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> SHOW真的滑板比赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> New Board滑板协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛项目：</strong></span></p><p style=\"text-align: start;\">本次比赛设置多个滑板项目，包括但不限于：</p><ol><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>技巧赛：</strong></span> 参赛选手将展示自己的滑板技巧，进行各种高难度动作和组合。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>速度赛：</strong></span> 参赛选手将在规定的赛道上进行速度比拼，争夺最快速度的荣耀。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>自由式滑板赛：</strong></span> 参赛选手将在自选区域进行自由式滑板表演，展示个人独特风格和创意动作。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">比赛将采用个人赛制，根据各项比赛项目设置不同的比赛规则和评分标准。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的技艺和表现，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军奖杯及奖品</li><li style=\"text-align: start;\">亚军奖品</li><li style=\"text-align: start;\">季军奖品</li><li style=\"text-align: start;\">最佳技巧奖</li><li style=\"text-align: start;\">最佳速度奖</li><li style=\"text-align: start;\">最佳创意奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参赛的滑板爱好者在指定时间内通过New Board滑板协会官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">New Board滑板协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">New Board滑板协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">New Board滑板协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同展现真正的滑板技艺，挑战极限，追逐激情！期待您的参与！</p><p style=\"text-align: start;\">New Board滑板协会 敬上</p>', 33, '2024-05-05 08:12:49', '2024-05-05 18:09:49', '西南科技大学新区七彩虹广场', '/activityUploads/a088e3bae4432cb7662ec27099e5e5ef', '', '/5120200001,4/5120200002,2');
INSERT INTO `tb_activities` VALUES (14, '“杠精来了”辩论大赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>“杠精来了”辩论大赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的辩论爱好者们，</p><p style=\"text-align: start;\">演讲与辩论协会自豪地宣布，我们将举办一场激动人心的“杠精来了”辩论大赛！这将是一个思维碰撞、言辞激烈的辩论盛会，让我们齐聚一堂，挑战思维，展现口才，共同见证辩论的魅力！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> “杠精来了”辩论大赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 演讲与辩论协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">本次辩论大赛将采用团队辩论的形式进行，每个队伍由多名成员组成，包括正方和反方。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>辩题设置：</strong></span></p><p style=\"text-align: start;\">我们将设置一系列富有挑战性和争议性的辩题，涵盖社会热点、时事政治、文化教育等多个领域，让参赛选手充分展现自己的辩论才华和见解。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的辩论技艺和表现，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军团队奖杯及奖品</li><li style=\"text-align: start;\">亚军团队奖品</li><li style=\"text-align: start;\">季军团队奖品</li><li style=\"text-align: start;\">最佳辩手奖</li><li style=\"text-align: start;\">最佳团队协作奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参加比赛的同学在指定时间内通过演讲与辩论协会官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">演讲与辩论协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">演讲与辩论协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">演讲与辩论协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同迎接挑战，展现才华，探讨观点，共同见证“杠精来了”辩论大赛的精彩！期待您的参与！</p><p style=\"text-align: start;\">演讲与辩论协会 敬上</p>', 82, '2024-05-12 00:00:00', '2024-05-19 00:00:00', '西南科技大学演播大厅', '/activityUploads/4ba5aa95372f999af1f30fda19ff9719', '校园辩论赛要求.docx /activityUploads/c9e0b95204cd1292e7252db742ce6547', '/5120200001,4/5120200002,2');
INSERT INTO `tb_activities` VALUES (15, '西南科技大学第13届机器人大赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>西南科技大学第13届机器人大赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的同学们，</p><p style=\"text-align: start;\">计算机与人工智能协会自豪地宣布，将举办西南科技大学第13届机器人大赛！这是一个展示创新能力、挑战科技极限的盛会，我们诚挚邀请您的参与，共同探索机器人科技的无限可能！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 西南科技大学第13届机器人大赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 计算机与人工智能协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛项目：</strong></span></p><p style=\"text-align: start;\">本次机器人大赛将设置多个创新性和挑战性的比赛项目，包括但不限于：</p><ol><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>自主导航挑战：</strong></span> 参赛队伍需设计机器人完成特定场景下的自主导航任务，如避障、路径规划等。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>机器人足球赛：</strong></span> 参赛队伍将设计并操控机器人参与足球比赛，展现机器人协同作战的能力。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>创意机器人设计：</strong></span> 参赛队伍可自由发挥，设计并展示自己独特的机器人作品，体现创意和技术水平。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">比赛将分为初赛和决赛两个阶段进行，初赛将筛选出优秀队伍进入决赛，决赛将决定最终的获奖名次。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀队伍的创新和实力，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军奖金及证书</li><li style=\"text-align: start;\">亚军奖金及证书</li><li style=\"text-align: start;\">季军奖金及证书</li><li style=\"text-align: start;\">最佳创意奖</li><li style=\"text-align: start;\">最佳工程设计奖</li><li style=\"text-align: start;\">最佳表现奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请各院系及有意参赛的同学在指定时间内通过计算机与人工智能协会官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">计算机与人工智能协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">计算机与人工智能协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">计算机与人工智能协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们携手共进，挑战机器人科技的新高度，共创机器人大赛的精彩！期待您的参与！</p><p style=\"text-align: start;\">计算机与人工智能协会 敬上</p>', 66, '2024-06-02 00:00:00', '2024-06-09 00:00:00', '西南科技大学新区', '/activityUploads/63a9c0f821438ee8b81e2f8de5cfe135', '机器人比赛.docx /activityUploads/cb012aef198fdbf2a1256d5ff5082767', '/5120200001,4/5120200002,2');
INSERT INTO `tb_activities` VALUES (16, '“一杆清台”台球比赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>“一杆清台”台球比赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的台球爱好者们，</p><p style=\"text-align: start;\">台球协会荣幸地宣布，我们将举办一场激动人心的“一杆清台”台球比赛！这将是一个展现球技、挑战技术的盛会，让我们共同挥杆、争夺高手荣耀，共赴一场球技盛宴！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> “一杆清台”台球比赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 台球协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛项目：</strong></span></p><p style=\"text-align: start;\">本次比赛设置多个项目，包括但不限于：</p><ol><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>直杆清台赛：</strong></span> 参赛选手需在规定时间内一杆清台，挑战自己的技术极限。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>速度球比赛：</strong></span> 参赛选手在规定时间内完成速度球比拼，争夺最快杆速。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>自由式对决：</strong></span> 参赛选手自由发挥，进行自由式对决，展示个人球技和创意表演。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的球技和表现，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">冠军奖杯及奖品</li><li style=\"text-align: start;\">亚军奖品</li><li style=\"text-align: start;\">季军奖品</li><li style=\"text-align: start;\">最佳球技奖</li><li style=\"text-align: start;\">最佳新秀奖</li><li style=\"text-align: start;\">最佳创意奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参加比赛的同学在指定时间内通过台球协会官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">台球协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">台球协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">台球协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同挥杆，追逐一杆清台的梦想，共享台球的乐趣！期待您的参与！</p><p style=\"text-align: start;\">台球协会 敬上</p>', 4, '2024-05-23 00:00:00', '2024-05-23 17:13:17', '西南科技大学老区北门外台球厅', '/activityUploads/97b650b9ab6492fefa8a229b84786c85', '', '/5120200001,3/5120200002,5');
INSERT INTO `tb_activities` VALUES (17, '西南科技大学十佳歌手-2024', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>西南科技大学十佳歌手-2024 歌唱比赛通知</strong></span></p><p style=\"text-align: start;\">亲爱的音乐爱好者们，</p><p style=\"text-align: start;\">现代音乐协会荣幸地宣布，我们将举办西南科技大学十佳歌手-2024歌唱比赛！这是一个展现歌唱才华、展示音乐魅力的盛会，让我们齐聚一堂，共同倾听动人音符，见证音乐的魔力！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 西南科技大学十佳歌手-2024</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 现代音乐协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛项目：</strong></span></p><p style=\"text-align: start;\">本次比赛将包括但不限于以下项目：</p><ol><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>个人歌唱比赛：</strong></span> 参赛者将独自演唱一首自选歌曲，展示个人的音乐风格和演唱技巧。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>合唱团比赛：</strong></span> 合唱团将演唱一首指定曲目，展现团队的合作精神和音乐凝聚力。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的歌唱才华和表现，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">十佳歌手奖</li><li style=\"text-align: start;\">最佳人气奖</li><li style=\"text-align: start;\">最佳舞台表现奖</li><li style=\"text-align: start;\">最佳音乐创意奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参加比赛的同学在指定时间内通过现代音乐协会官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">现代音乐协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">现代音乐协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">现代音乐协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们共同唱响青春之歌，奏响梦想旋律，共享音乐的美好时光！期待您的参与！</p><p style=\"text-align: start;\">现代音乐协会 敬上</p>', 13, '2024-06-02 00:00:00', '2024-06-04 00:00:00', '西南科技大学演播大厅', '/activityUploads/de11740c6583540fea5e54ba6810467e', '西南科技大学十佳歌手比赛.docx /activityUploads/22a87c3168ce0f0fae9d4261849268a2', '/5120200001,4/5120200002,5');
INSERT INTO `tb_activities` VALUES (18, '乒乓球协会5月积分赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>西南科技大学乒乓球协会5月积分赛通知</strong></span></p><p style=\"text-align: start;\">尊敬的乒乓球爱好者们，</p><p style=\"text-align: start;\">西南科技大学乒乓球协会荣幸地宣布，我们将于本月举办乒乓球积分赛！这将是一个展现球技、挑战实力的盛会，让我们共同挥拍、争夺荣誉，共享乒乓球的乐趣！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span> 西南科技大学乒乓球协会5月积分赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 乒乓球协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛内容：</strong></span></p><p style=\"text-align: start;\">本次积分赛将包括但不限于以下比赛项目：</p><ol><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>男子单打赛：</strong></span> 个人赛，男性选手单打比拼，争夺个人积分。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>女子单打赛：</strong></span> 个人赛，女性选手单打比拼，争夺个人积分。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>男子双打赛：</strong></span> 团体赛，男性选手组成双打团队比拼，争夺团体积分。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>女子双打赛：</strong></span> 团体赛，女性选手组成双打团队比拼，争夺团体积分。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛形式：</strong></span></p><p style=\"text-align: start;\">比赛将采用积分制度，根据比赛结果给予选手相应的积分，累计积分最高者将获得相应奖项。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的球技和表现，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">男子单打冠军、亚军、季军</li><li style=\"text-align: start;\">女子单打冠军、亚军、季军</li><li style=\"text-align: start;\">男子双打冠军、亚军、季军</li><li style=\"text-align: start;\">女子双打冠军、亚军、季军</li><li style=\"text-align: start;\">最佳球员奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛将于 [比赛时间] 在 [比赛地点] 举行，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参加比赛的同学在指定时间内通过乒乓球协会官方网站或线下报名点报名参赛。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">乒乓球协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">乒乓球协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">乒乓球协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同挥拍、争夺积分，享受乒乓球的激情！期待您的参与！</p><p style=\"text-align: start;\">乒乓球协会 敬上</p>', 42, '2024-05-19 00:00:00', '2024-05-19 18:23:34', '西南科技大学新区体育馆乒乓球馆', '/activityUploads/3ab900526a66d13648e0cf838b7b8479', '乒乓球协会5月积分赛详情.docx /activityUploads/67086fa7dbe38dbacca9a7ec53dcc179', '/5120200001,3/5120200002,4');
INSERT INTO `tb_activities` VALUES (19, '“笔墨千年”校园书法大赛', '<p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>“笔墨千年”校园书法大赛通知</strong></span></p><p style=\"text-align: start;\">亲爱的书法爱好者们，</p><p style=\"text-align: start;\">西南科技大学书法与绘画协会荣幸地宣布，我们将举办校园书法大赛！这将是一个展现笔墨之美、传承中华文化的盛会，让我们共同挥毫、展现书法魅力，共享艺术的美好时光！</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛详情：</strong></span></p><ul><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛名称：</strong></span>“笔墨千年”校园书法大赛</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>主办单位：</strong></span> 书法与绘画协会</li></ul><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛内容：</strong></span></p><p style=\"text-align: start;\">本次书法大赛将包括但不限于以下比赛项目：</p><ol><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>楷书作品赛：</strong></span> 参赛者需提交一份楷书作品，展现工整规范的书写技巧。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>行书作品赛：</strong></span> 参赛者需提交一份行书作品，展现流畅优美的书写风格。</li><li style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>草书作品赛：</strong></span> 参赛者需提交一份草书作品，展现潇洒豪放的书写气韵。</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>奖项设置：</strong></span></p><p style=\"text-align: start;\">我们将设置丰厚的奖项，以表彰优秀选手的书法才华和作品表现，奖项包括但不限于：</p><ol><li style=\"text-align: start;\">优秀楷书作品奖</li><li style=\"text-align: start;\">优秀行书作品奖</li><li style=\"text-align: start;\">优秀草书作品奖</li><li style=\"text-align: start;\">最具创意奖</li><li style=\"text-align: start;\">最佳技艺奖</li></ol><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>比赛时间：</strong></span></p><p style=\"text-align: start;\">比赛作品需于 [报名截止日期] 前提交至指定地点，具体比赛时间安排将另行通知。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>报名方式：</strong></span></p><p style=\"text-align: start;\">请有意参加比赛的同学在指定时间内通过书法与绘画协会官方网站或线下报名点报名参赛，并按要求提交作品。</p><p style=\"text-align: start;\"><span style=\"color: var(--tw-prose-bold);\"><strong>联系方式：</strong></span></p><p style=\"text-align: start;\">如有任何疑问或咨询，请联系我们：</p><ul><li style=\"text-align: start;\">书法与绘画协会官方网站：[官方网站链接]</li><li style=\"text-align: start;\">书法与绘画协会联系邮箱：[联系邮箱]</li><li style=\"text-align: start;\">书法与绘画协会联系电话：[联系电话]</li></ul><p style=\"text-align: start;\">让我们一同挥毫、感受文字之美，书写青春之篇章！期待您的参与！</p><p style=\"text-align: start;\">书法与绘画协会 敬上</p>', 27, '2024-05-26 00:00:00', '2024-05-26 23:23:10', '西南科技大学西101广场', '/activityUploads/c1f76e27173c753324ef7e2e88811edf', '书法比赛.docx /activityUploads/c50a7c8cd802051a6372f51985482dfb', '/5120200001,2/5120200002,3');
