INSERT INTO `tb_clubnews` VALUES (3, 42, '2024-04-08 22:04:35', '2024年春季招新 | 加入乒乓球社，挥拍畅游校园！', '<p style=\"text-align: start;\">亲爱的同学们，</p><p style=\"text-align: start;\">随着2024年春季的脚步渐近，我们诚挚地邀请你加入我们充满激情和活力的乒乓球社！作为一名乒乓球社员，你将有机会与志同道合的球友们一起挥拍，畅游在乒乓球的海洋中，体验乒乓球带来的无尽乐趣和健康活动的美好。</p><p style=\"text-align: start;\">我们的乒乓球社旨在为校园内对乒乓球感兴趣的同学们提供一个交流、学习和锻炼的平台。无论你是初学者还是资深球手，我们都欢迎你的加入。在这里，你将有机会学习到乒乓球的基本技巧、战术技巧，以及与其他社员们一起切磋球艺，共同提高。</p><p style=\"text-align: start;\">招新时间：[具体时间]<br>招新地点：[具体地点]</p><p style=\"text-align: start;\">作为乒乓球社的一员，你将享受到以下福利：</p><ol><li style=\"text-align: start;\">与球友们一起进行友谊赛和训练，提升技术水平；</li><li style=\"text-align: start;\">参加校内外各类乒乓球比赛，展现个人风采；</li><li style=\"text-align: start;\">丰富多彩的社团活动，包括乒乓球知识讲座、主题讨论等，增长见识；</li><li style=\"text-align: start;\">充满活力和凝聚力的社团氛围，结识志同道合的好友，共同度过美好的大学时光。</li></ol><p style=\"text-align: start;\">如果你对乒乓球充满热爱，想要在校园中寻找一个志同道合的团体，那么不要犹豫，加入我们吧！让我们一起挥拍，畅游在乒乓球的世界中，创造属于我们的精彩！</p><p style=\"text-align: start;\">期待您的加入！</p><p style=\"text-align: start;\">乒乓球社 社长</p>');
INSERT INTO `tb_clubnews` VALUES (4, 41, '2024-04-08 22:06:46', '2024年春季招新 | 踢出激情，燃放青春！', '<p style=\"text-align: start;\">亲爱的同学们，</p><p style=\"text-align: start;\">迎接2024年春季的到来，我们诚挚邀请你加入我们充满活力和激情的足球社！作为一名足球社员，你将有机会与同样热爱足球的伙伴们一起奔跑、挥汗，体验足球带来的快乐和团队合作的魅力。</p><p style=\"text-align: start;\">足球社是一个充满热情和活力的团体，我们致力于为校园内的足球爱好者提供一个交流、学习和锻炼的平台。无论你是足球初学者还是有着丰富经验的球员，我们都欢迎你的加入。在这里，你将有机会提升足球技术、拓展足球视野，与其他社员共同切磋球艺，共同进步。</p><p style=\"text-align: start;\">招新时间：[具体时间]<br>招新地点：[具体地点]</p><p style=\"text-align: start;\">作为足球社的一员，你将享受到以下福利：</p><ol><li style=\"text-align: start;\">参与社团内部的友谊赛和训练，提升技术水平；</li><li style=\"text-align: start;\">参加校内外各类足球比赛，展现个人风采；</li><li style=\"text-align: start;\">举办各类足球相关活动，如足球讲座、技术培训等，丰富你的足球知识；</li><li style=\"text-align: start;\">充满团队凝聚力的社团氛围，结识志同道合的朋友，共同度过难忘的大学时光。</li></ol><p style=\"text-align: start;\">如果你热爱足球，渴望在校园中找到一个热爱足球的团体，那么千万不要犹豫，加入我们吧！让我们一起踢出激情，创造属于我们的足球传奇！</p><p style=\"text-align: start;\">期待着你的加入！</p><p style=\"text-align: start;\">足球社 社长</p>');
INSERT INTO `tb_clubnews` VALUES (5, 27, '2024-04-08 22:09:33', '2024年春季招新 | 书法绘画协会，艺术的殿堂等你来！', '<p style=\"text-align: start;\">亲爱的同学们，</p><p style=\"text-align: start;\">2024年春季，书法绘画协会欢迎您的加入！如果您对书法、绘画充满热情，渴望在艺术的殿堂中展现自己的才华和创意，那么不要错过这个难得的机会！</p><p style=\"text-align: start;\">书法绘画协会是一个让学生们汲取艺术灵感、提升技能的家园。无论您是初学者还是资深爱好者，我们都诚邀您的加入。在这里，您将有机会与志同道合的艺术爱好者一起探讨艺术，学习书法绘画的技巧，共同创作，共同成长。</p><p style=\"text-align: start;\">招新时间：[具体时间]<br>招新地点：[具体地点]</p><p style=\"text-align: start;\">加入书法绘画协会，您将获得以下福利：</p><ol><li style=\"text-align: start;\">参与书法绘画活动和比赛，展示个人才华；</li><li style=\"text-align: start;\">参加各类书法绘画讲座和工作坊，拓展艺术视野；</li><li style=\"text-align: start;\">与艺术界的大师互动，学习他们的经验和技巧；</li><li style=\"text-align: start;\">举办展览和分享会，展示成果，与校内外艺术爱好者交流。</li></ol><p style=\"text-align: start;\">如果您热爱艺术，希望在大学生活中寻找一个与您志同道合的团体，那么不要犹豫，加入我们吧！让我们一起在书法绘画的世界中创造美好，留下青春的足迹！</p><p style=\"text-align: start;\">期待着您的加入！</p><p style=\"text-align: start;\">书法绘画协会 社长</p>');
INSERT INTO `tb_clubnews` VALUES (6, 33, '2024-04-08 22:10:38', '2024年春季招新 | 踏上滑板，与New Board一起飞', '<p style=\"text-align: start;\">亲爱的同学们，</p><p style=\"text-align: start;\">迎接2024年春季的到来，New Board滑板协会热情邀请你加入我们！如果你对滑板运动充满热爱，渴望在校园中找到一个与你志同道合的团体，那么这里就是你的家！</p><p style=\"text-align: start;\">New Board滑板协会是一个充满活力和激情的团体，我们致力于推广滑板文化，促进滑板爱好者之间的交流与合作。无论你是刚入门的新手还是技艺高超的老手，我们都欢迎你的加入。在这里，你将有机会与滑板运动的热爱者一起切磋技艺、挑战自我，体验滑板运动的乐趣与激情。</p><p style=\"text-align: start;\">招新时间：[具体时间]<br>招新地点：[具体地点]</p><p style=\"text-align: start;\">加入New Board滑板协会，你将享受到以下福利：</p><ol><li style=\"text-align: start;\">参与社团组织的滑板活动和比赛，展现个人风采；</li><li style=\"text-align: start;\">参加滑板技巧培训和讲座，提升技术水平；</li><li style=\"text-align: start;\">探索滑板文化，了解滑板装备和技术，拓展滑板视野；</li><li style=\"text-align: start;\">共同打造充满活力和凝聚力的社团氛围，结识志同道合的滑板爱好者，共同度过难忘的大学时光。</li></ol><p style=\"text-align: start;\">如果你热爱滑板运动，渴望在校园中找到一个充满激情的团体，那么不要犹豫，加入我们吧！让我们一起踏上滑板，飞向自由与激情的天空！</p><p style=\"text-align: start;\">期待着你的加入！</p><p style=\"text-align: start;\">New Board滑板协会 社长</p>');
INSERT INTO `tb_clubnews` VALUES (7, 45, '2024-04-08 22:11:41', '2024年春季招新 | 绿芽公益协会，点亮爱心，共筑梦想！', '<p style=\"text-align: start;\">亲爱的同学们，</p><p style=\"text-align: start;\">2024年春季，绿芽公益协会诚邀你加入我们的行列！如果你对公益事业充满热情，渴望用自己的行动去关爱他人，那么绿芽公益协会将是你展现爱心、传递温暖的最佳平台！</p><p style=\"text-align: start;\">绿芽公益协会是一个关注社会、关爱他人的团体，我们致力于参与各类公益活动，为社会弱势群体提供帮助和支持。无论你是公益新人还是有丰富经验的志愿者，我们都欢迎你的加入。在这里，你将有机会与热心公益的伙伴们一起，投入到志愿服务中，为社会贡献自己的一份力量。</p><p style=\"text-align: start;\">招新时间：[具体时间]<br>招新地点：[具体地点]</p><p style=\"text-align: start;\">加入绿芽公益协会，你将体验到以下乐趣与收获：</p><ol><li style=\"text-align: start;\">参与各类公益活动和志愿服务，关爱社会，回馈社会；</li><li style=\"text-align: start;\">参加公益项目策划和组织，锻炼领导力和团队合作能力；</li><li style=\"text-align: start;\">参与公益讲座和培训，提升公益意识和社会责任感；</li><li style=\"text-align: start;\">结识志同道合的伙伴，共同分享公益心得，共同成长。</li></ol><p style=\"text-align: start;\">如果你热爱公益事业，渴望在校园中找到一个有爱心、有责任感的团体，那么绿芽公益协会将是你不可错过的选择！让我们携手并肩，点亮爱心，共筑梦想！</p><p style=\"text-align: start;\">期待着你的加入！</p><p style=\"text-align: start;\">绿芽公益协会 社长</p>');
INSERT INTO `tb_clubnews` VALUES (8, 52, '2024-04-08 22:13:35', '2024年春季招新 | 数学建模协会，探索数学世界，解锁智慧', '<p style=\"text-align: start;\">亲爱的同学们，</p><p style=\"text-align: start;\">2024年春季，数学建模协会热情邀请您加入我们！如果您对数学充满兴趣，渴望探索数学的无穷魅力，那么数学建模协会将是您展示才华、挑战智慧的绝佳平台！</p><p style=\"text-align: start;\">数学建模协会是一个汇聚数学爱好者的家园，我们致力于研究数学建模，参与各类数学竞赛和实践项目。无论您是数学天才还是初学者，我们都欢迎您的加入。在这里，您将有机会与志同道合的同学们一起探索数学的奥秘，解锁智慧之门，共同成长。</p><p style=\"text-align: start;\">招新时间：[具体时间]<br>招新地点：[具体地点]</p><p style=\"text-align: start;\">加入数学建模协会，您将获得以下乐趣与收获：</p><ol><li style=\"text-align: start;\">参与数学建模竞赛和实践项目，锻炼数学建模能力；</li><li style=\"text-align: start;\">参加数学讲座和研讨会，拓展数学知识和视野；</li><li style=\"text-align: start;\">探索数学的应用领域，解决实际问题，展现个人才华；</li><li style=\"text-align: start;\">与优秀的数学爱好者交流学习，共同探讨数学问题，共同进步。</li></ol><p style=\"text-align: start;\">如果您热爱数学，渴望在校园中找到一个有趣有益的团体，那么数学建模协会将是您不可错过的选择！让我们一起携手，探索数学的世界，开启智慧的旅程！</p><p style=\"text-align: start;\">期待着您的加入！</p><p style=\"text-align: start;\">数学建模协会 社长</p>');
INSERT INTO `tb_clubnews` VALUES (9, 66, '2024-04-08 22:21:01', '2024年春季招新 | 计算机与人工智能协会，探索未来，创造', '<p style=\"text-align: start;\">亲爱的同学们，</p><p style=\"text-align: start;\">2024年春季，计算机与人工智能协会诚邀您加入我们的行列！如果您对计算机科学和人工智能充满热情，渴望在科技的前沿探索、实践，那么这里将是您展现才华、挑战极限的最佳舞台！</p><p style=\"text-align: start;\">计算机与人工智能协会是一个致力于探索计算机科学和人工智能领域的团体，我们致力于开展各类技术研究、项目实践和学术交流活动。无论您是计算机专业的学生还是对人工智能充满好奇的跨专业学生，我们都欢迎您的加入。在这里，您将有机会与志同道合的同学们一起学习、探索、创造，共同成长。</p><p style=\"text-align: start;\">招新时间：[具体时间]<br>招新地点：[具体地点]</p><p style=\"text-align: start;\">加入计算机与人工智能协会，您将获得以下乐趣与收获：</p><ol><li style=\"text-align: start;\">参与项目开发和实践活动，锻炼编程和算法能力；</li><li style=\"text-align: start;\">参加技术讲座和研讨会，拓展计算机和人工智能知识；</li><li style=\"text-align: start;\">探索人工智能的前沿技术和应用领域，参与科技创新；</li><li style=\"text-align: start;\">与优秀的同学们共同交流学习，开展合作项目，实现技术梦想。</li></ol><p style=\"text-align: start;\">如果您热爱科技，渴望在校园中找到一个有活力、有创新的团体，那么计算机与人工智能协会将是您的理想选择！让我们一起探索未来，创造智慧，共同书写属于我们的科技传奇！</p><p style=\"text-align: start;\">期待着您的加入！</p><p style=\"text-align: start;\">计算机与人工智能协会 社长</p>');
INSERT INTO `tb_clubs` VALUES (1, 'IE技能协会', '/clubAvatarUploads/ec1c590ff52441f29f26b0c668a2c1ec', '\"IE技能协会社团\"是一个致力于提升学生在信息工程领域技能的学术组织。我们为学生提供了一个学习、实践和分享技术知识的平台，涵盖了计算机科学、软件工程、网络技术等多个领域。通过组织工作坊、讲座和项目实践，我们帮助成员拓展专业技能，并促进交流与合作。加入我们，探索无限的技术可能！', '2012-10-12', '计算机科学与技术学院', '5120200001', 70, '/clubAvatarUploads/8736d6cda8f69bf1929912a2c06477c4', '探索网络未来的引擎!\\Engine of Exploring the Future of Networking!', 1, 4321);
