INSERT INTO `tb_clubs` VALUES (3, '青出于蓝合唱协会', '/clubAvatarUploads/1afcaadbf33a5cca3f56eb6824f4653d', '\"青出于蓝合唱协会\"是一个热爱音乐、热爱合唱的团体。我们汇集了一群充满热情、才华横溢的歌手，致力于探索声音的魅力，创造出美妙动人的音乐。通过不断的排练、演出和音乐活动，我们不仅提升了自己的音乐技能，也传递着美好、感动和团结的情感。加入我们，让我们共同奏响青春的旋律，展现青年的风采！', '2012-12-14', '计算机科学与技术学院', '5120201780', 68, '/clubAvatarUploads/eca932f40bbb50eebbca8c0f3813a972', '和声共鸣，心声传情!\\Harmonizing Voices, Echoing Hearts!', 2, 3261);
INSERT INTO `tb_clubs` VALUES (4, '台球协会', '/clubAvatarUploads/0ddeaedde6e65864255a0cc61bda5702', '\"台球协会\"是一个热爱台球运动的社团。我们致力于促进台球运动的普及与发展，提倡团队合作与友谊。通过组织比赛、培训课程和社交活动，我们为会员提供了锻炼技能、交流经验和建立联系的机会。无论你是初学者还是高手，我们都欢迎你的加入。加入我们，一起挥杆、切磋技艺，享受台球运动带来的乐趣与挑战！', '2014-03-14', '制造科学与工程学院', '5120201107', 78, '/clubAvatarUploads/6b35994f595a6d91efb04cadd537d45a', '挥杆畅快，球场激情!\\Swinging Joy, Field of Passion!', 6, 3606);
INSERT INTO `tb_clubs` VALUES (5, '智能机械协会', '/clubAvatarUploads/82c7e413db0e57e34744689d26d35999', '\"智能机械协会\"致力于探索和推动智能机械技术的发展。我们汇聚了一群对机械工程和人工智能充满热情的学生，通过学术研讨会、项目实践和创新竞赛，探索智能机械在各个领域的应用。我们旨在培养会员的创新能力、团队协作精神和技术实践能力，为未来智能机械行业的发展做出贡献。加入我们，开启智慧与机械的无限可能！', '2012-02-28', '制造科学与工程学院', '5120201610', 72, '/clubAvatarUploads/fe8631e500ca53c68b16bc25562e4acc', '创新未来，智能生活!\\Innovating Tomorrow, Intelligent Living!', 5, 3521);
INSERT INTO `tb_clubs` VALUES (6, '电子爱好者协会', '/clubAvatarUploads/531533d08fdf2015e6b9481410590d8a', '\"电子爱好者协会\"是一个热爱电子科技的团体。我们致力于探索电子领域的新技术和应用，促进会员之间的交流与合作。通过举办讲座、工作坊和项目实践，我们为会员提供了学习、实践和创新的平台。不论你是电子领域的新手还是资深爱好者，我们都欢迎你的加入。加入我们，让我们一起探索电子世界的奥秘，创造出更多精彩的科技作品！', '2013-12-17', '制造科学与工程学院', '5120201770', 76, '/clubAvatarUploads/f0ff0c00b3c64479e41a89b4c381fd39', '电潮涌动，创意无限!\\Surging Currents, Infinite Creativity!', 6, 2202);
INSERT INTO `tb_clubs` VALUES (7, '电子竞技协会', '/clubAvatarUploads/7a8a946860bf56418318b1e13d23c111', '\"电子竞技协会\"致力于培养和促进电子游戏文化。我们聚集了一群热爱电子竞技的成员，通过举办比赛、培训和社交活动，搭建了一个分享技能、交流经验的平台。我们欢迎所有对电子竞技感兴趣的人加入我们的行列。无论你是新手还是老手，加入我们，和志同道合的伙伴一起体验电子竞技的乐趣！', '2015-05-09', '制造科学与工程学院', '5120201903', 69, '/clubAvatarUploads/3ab1b79c80dc9a5fc2187ad5cdedeb8e', '电竞狂潮，共赴胜利之路!\\Riding the esports wave, together towards victory!', 6, 2423);
INSERT INTO `tb_clubs` VALUES (8, '缘梦戏剧社', '/clubAvatarUploads/a81cade37f3ac639086e9e1d6eadb3ce', '\"缘梦戏剧社\"是一个热爱戏剧艺术的社团。我们致力于探索舞台艺术的魅力，培养会员的表演技能和创作能力。通过剧场表演、话剧演出和戏剧工作坊，我们为会员提供了展示才华、锻炼表演技巧和丰富艺术生活的机会。无论你是演员、导演、编剧还是舞台设计师，加入我们，让我们一起梦想、一起演绎，共享戏剧艺术带来的感动和快乐！', '2014-02-13', '文学与艺术学院', '5120201328', 79, '/clubAvatarUploads/a7fc20c36598532bc90b2d76d9fdd243', '舞台梦想，表演风采!\\Stage Dreams, Performance Brilliance!', 2, 1388);
INSERT INTO `tb_clubs` VALUES (9, '宫羽民族器乐协会', '/clubAvatarUploads/d9cf8537f6e5c57fd9cedea0279dbf8c', '\"宫羽民族器乐协会\"是一个致力于传承和发展民族器乐艺术的团体。我们汇聚了一批热爱民族音乐的成员，通过学习、演奏和分享，探索各种民族乐器的美妙之处。通过举办演奏会、音乐交流活动和文化展示，我们为会员提供了展示才华、传承文化、交流经验的平台。加入我们，让我们一起弹奏、一起传承，共同探索民族音乐的深厚底蕴和魅力！', '2015-12-04', '文学与艺术学院', '5120201700', 85, '/clubAvatarUploads/4793f22c7fa734d821b68ea500ead52a', '传承乐韵，跨越时空!\\Heritage Harmonies, Transcending Time!', 2, 5006);
INSERT INTO `tb_clubs` VALUES (10, '国学社', '/clubAvatarUploads/69637d6e2a9573da69b580466781a157', '\"国学社\"是一个致力于传承和弘扬中华传统文化的团体。我们秉承着对中国传统文化的热爱与尊重，通过学习经典著作、举办讲座和文化活动，探索中华文明的博大精深。我们致力于传播中华传统礼仪、思想和价值观，培养会员的文化自觉和民族自豪感。加入我们，让我们一起探寻传统智慧的珍宝，弘扬中华文化的光辉！', '2012-10-06', '文学与艺术学院', '5120202176', 80, '/clubAvatarUploads/636d6a9283b6b0e3bb62a0bacc8e4463', '传统智慧，当代启迪\\Traditional Wisdom, Contemporary Enlightenment!', 2, 690);
INSERT INTO `tb_clubs` VALUES (11, '含章汉文化协会', '/clubAvatarUploads/83b3af8dead9fc7ed737dfbf942539f0', '\"含章汉文化协会\"是一个致力于弘扬中华汉文化的团体。我们以传统文化为基石，秉承着对汉族传统文化的热爱和尊重，通过学习、传承、交流，探索中华文明的博大精深。协会活动涵盖经典诗词、书法、传统节日等方面，旨在传播传统文化的魅力，培养会员的文化自信和民族自豪感。加入我们，让我们共同弘扬中华文化的光辉，传承中华民族的优秀传统！', '2011-07-01', '文学与艺术学院', '5120202435', 79, '/clubAvatarUploads/1715e450234a774ed8fec259e55fa646', '千年传承，文化荣耀!\\Millennia Legacy, Cultural Glory!', 2, 4061);
INSERT INTO `tb_clubs` VALUES (12, '萨克斯管协会', '/clubAvatarUploads/9ac82f2cfbf9c970dd3ef0f8a980b4f9', '\"萨克斯管协会\"是一个热爱萨克斯管音乐的社团。我们聚集了一群对萨克斯管充满热情的音乐爱好者，致力于推广和传承萨克斯管艺术。通过举办音乐会、演奏会和工作坊，我们为会员提供了展示才华、提升演奏技巧和交流音乐经验的平台。无论你是初学者还是专业演奏者，加入我们，让我们一起分享萨克斯管音乐的魅力，创造出更多美妙的音乐！', '2012-08-21', '文学与艺术学院', '5120202666', 82, '/clubAvatarUploads/5e436fdc2998694e5603f070b4d4abb1', '激情演奏，音乐之魂!\\Passionate Performance, Soul of Music!', 2, 3591);
INSERT INTO `tb_clubs` VALUES (13, '现代音乐协会', '/clubAvatarUploads/f7b067cdfa2eec876db5fd3471d0ed8e', '\"现代音乐协会\"是一个致力于推广和探索现代音乐艺术的团体。我们聚集了一群对现代音乐充满热情的音乐爱好者，不拘一格地欣赏和创造各种类型的音乐作品。通过举办音乐会、音乐创作比赛和研讨会，我们为会员提供了展示才华、学习技能和交流经验的平台。无论你是喜欢演奏、创作、还是欣赏现代音乐的人，加入我们，一起探索现代音乐的无限可能性！', '2013-06-26', '文学与艺术学院', '5120202716', 75, '/clubAvatarUploads/3f162eda2a0a90fed9b11c7243340d86', '音乐创新，跨界探索!\\Innovating Melodies, Exploring Boundaries!', 2, 3690);
