INSERT INTO `tb_clubs` VALUES (19, 'BIM协会', '/clubAvatarUploads/d241c5ee999aae67859140683409f45f', '\"BIM协会\"致力于推广和应用建筑信息模型（BIM）技术。我们为会员提供了学习、交流和实践BIM技术的平台，通过举办讲座、工作坊和项目实践，帮助会员掌握BIM技术的理论和实践应用。无论你是建筑设计师、工程师还是对BIM技术感兴趣的人士，我们都欢迎你的加入。加入我们，一起探索BIM技术的前沿，共同促进建筑行业的发展与创新！', '2013-12-06', '环境与资源学院', '5120201159', 65, '/clubAvatarUploads/d5aa9b3ffcf2221894879a61af1aa37c', '数字建筑，未来构想!\\Digital Architecture, Future Vision!', 1, 2791);
INSERT INTO `tb_clubs` VALUES (20, '城乡规划协会', '/clubAvatarUploads/de346c8f60b113d67ef3376babfefc12', '城乡规划协会是一个关注城市和乡村规划发展的组织。我们致力于促进城乡规划领域的交流、学习和实践。通过举办讲座、研讨会、考察活动和项目实践，协会为会员提供了一个分享经验、解决问题、探讨创新的平台。无论你是城乡规划从业者、学者、还是对城乡规划感兴趣的人士，我们都欢迎你的加入。加入我们，一起致力于创造宜居、可持续发展的城乡空间！', '2015-11-26', '环境与资源学院', '5120201199', 72, '/clubAvatarUploads/ee302320bf634565fcc6e5c7e332ddb4', '城市雄心，乡村情怀!\\Urban Ambition, Rural Sentiment!', 1, 1651);
INSERT INTO `tb_clubs` VALUES (21, '航空航天学社', '/clubAvatarUploads/273f3946b472ad66b32095df0ae37109', '航空航天学社是一个致力于探索航空航天领域的学术团体。我们聚集了一群对航空航天科技充满热情的成员，通过举办讲座、研讨会、实践活动和参观考察等形式，探讨航空航天技术的前沿发展、应用与挑战。无论你是对航空航天技术感兴趣的学生，还是希望从事相关职业的人士，我们都欢迎你的加入。加入我们，让我们一起探索蓝天的奥秘，开启航空航天梦想的征程！', '2015-09-13', '环境与资源学院', '5120201579', 73, '/clubAvatarUploads/2e595c331a3afea662f4893f977ada7e', '挑战宇宙，探索未来!\\Challenge the Universe, Explore the Future!', 6, 2890);
INSERT INTO `tb_clubs` VALUES (22, '环境控制与能源应用协会', '/clubAvatarUploads/eb25149705d0ba9f63bd40e543b07bff', '环境控制与能源应用协会致力于促进环境保护和能源利用领域的发展与应用。我们通过组织讲座、研讨会、实地考察等活动，探讨环境控制技术和能源应用的最新进展，促进会员之间的交流与合作。无论你是对环境保护、能源利用感兴趣的学生，还是希望在相关领域发展的专业人士，我们都欢迎你的加入。加入我们，共同致力于推动环境与能源领域的创新与进步，为可持续发展贡献力量！', '2010-12-20', '环境与资源学院', '5120201669', 79, '/clubAvatarUploads/038aa9efb3015aa58da1beaf479f5b95', '保护地球，拓展能源!\\Protecting Earth, Expanding Energy!', 1, 2735);
INSERT INTO `tb_clubs` VALUES (23, '极限拓展协会', '/clubAvatarUploads/10f9f34cc129552febf31b9fe357dac4', '\"极限拓展协会\"是一个旨在挑战个人极限、促进团队合作和发展领导力的组织。我们通过户外拓展活动、团队建设训练、冒险挑战等方式，提供了一个安全而充满挑战的环境，让会员们超越自我、培养团队精神，并探索领导力的潜力。无论你是寻求个人成长，还是希望提升团队合作能力，加入我们，一起挑战极限，创造更加充实的人生！', '2012-05-08', '土木工程与建筑学院', '5120201351', 59, '/clubAvatarUploads/9846f0e6a751305a555051360b96d318', '突破极限，挑战自我!\\Breaking Limits, Challenging Oneself!', 6, 745);
INSERT INTO `tb_clubs` VALUES (24, '建筑协会', '/clubAvatarUploads/667635fe95efed2dab4a81c1cd4168d0', '建筑协会是一个聚集建筑爱好者和专业人士的组织。我们致力于促进建筑领域的学习、交流和合作。通过举办讲座、工作坊、考察等活动，我们为会员提供了一个分享经验、探讨新理念和解决问题的平台。无论你是建筑设计师、工程师、还是对建筑艺术感兴趣的人士，加入我们，让我们共同探索建筑领域的魅力，推动建筑行业的发展和创新！', '2014-05-31', '土木工程与建筑学院', '5120201992', 81, '/clubAvatarUploads/066d714c36a3a46013adbc285eb34222', '筑梦未来，共铸城市之美!\\Building dreams, shaping the beauty of cities together!', 1, 3748);
INSERT INTO `tb_clubs` VALUES (25, '结构设计协会', '/clubAvatarUploads/0b4139f7f51743751b263763095e32f4', '结构设计协会是一个致力于探索和推动结构设计领域发展的组织。我们聚集了一群对结构设计充满热情的专业人士和学习者，通过举办讲座、研讨会、实践项目等活动，探讨结构设计的理论、技术和实践应用。我们致力于促进会员间的交流与合作，分享经验和技术，共同推动结构设计行业的创新与发展。无论你是结构设计师、工程师，还是对结构设计感兴趣的学生，加入我们，一起探索结构设计的奥秘，共同成长和进步！', '2012-02-04', '土木工程与建筑学院', '5120202114', 78, '/clubAvatarUploads/d5dd6a0e4b899d372b21b0c7c909a406', '构思未来，筑造梦想!\\Designing the Future, Building Dreams!', 1, 2375);
INSERT INTO `tb_clubs` VALUES (26, '民俗文化交流协会', '/clubAvatarUploads/b0ada0f91384f62fd57acb40e5491f0d', '民俗文化交流协会旨在传承和弘扬民俗文化，促进不同地域和民族之间的文化交流与理解。我们通过举办民俗文化展览、传统节日庆祝活动、民俗工艺品制作等形式，让会员和社会大众更加深入地了解和体验民俗文化的魅力。无论你是对传统文化感兴趣的人士，还是希望参与文化交流的学者，加入我们，一起探索民俗文化的丰富内涵，促进文化多样性的传承与发展！', '2015-03-12', '土木工程与建筑学院', '5120202159', 86, '/clubAvatarUploads/b7a88c895492d2cd051e42195f62ba2b', '传承乡愁，弘扬传统!\\Inheriting Nostalgia, Promoting Tradition!', 6, 2465);
INSERT INTO `tb_clubs` VALUES (27, '书法与绘画协会', '/clubAvatarUploads/d2682f375e70549617a63a97de6065ec', '书法与绘画协会致力于传承和发展中国传统书画艺术。我们提供书法和绘画爱好者一个学习、交流和展示作品的平台。通过举办书法、绘画工作坊、展览、比赛等活动，我们帮助会员提升技能、丰富艺术修养，并促进会员之间的交流与合作。无论你是初学者还是有一定水平的艺术家，加入我们，一起感受中国书画艺术的魅力，共同探索艺术的无限可能性！', '2014-01-29', '土木工程与建筑学院', '5120202245', 80, '/clubAvatarUploads/7d7a202a440f86a35cf83fea995970b1', '墨香画意，笔墨生花!\\Fragrance of Ink, Flourishing Brushstrokes!', 2, 1084);
INSERT INTO `tb_clubs` VALUES (28, '应用力学协会', '/clubAvatarUploads/f4826bea203bf561470029e29edd21ad', '应用力学协会致力于推动应用力学领域的学术交流与发展。我们聚集了一群对力学理论与应用感兴趣的学者、工程师和学生，通过组织讲座、研讨会、工程案例分享等活动，探讨力学在工程、科学和技术领域的应用及其相关研究。我们旨在促进会员之间的合作与交流，推动力学理论在实践中的应用与发展。欢迎对应用力学感兴趣的人士加入我们，共同探索力学领域的前沿与创新！', '2010-11-12', '土木工程与建筑学院', '5120202260', 64, '/clubAvatarUploads/6d6ee05f982f59c6703bbdd495b9b3d7', '理论实践，力量交融!\\Theoretical Practice, Fusion of Forces!', 1, 3177);
INSERT INTO `tb_clubs` VALUES (29, '羽毛球协会', '/clubAvatarUploads/a46101902decb75081fa31eb91ccae83', '羽毛球协会是一个致力于推广羽毛球运动、提升会员技术水平和促进团队合作的组织。我们通过组织比赛、训练课程、友谊赛以及羽毛球交流活动，为会员提供了锻炼身体、享受运动乐趣、结交志同道合的朋友的机会。无论你是初学者还是有一定水平的运动员，加入我们，一起挥拍、拼搏，享受羽毛球带来的健康和快乐！', '2012-08-05', '土木工程与建筑学院', '5120202323', 78, '/clubAvatarUploads/c8b4740a170f10fee31cd3f032a8ef02', '挥洒汗水，飞翔激情!\\Sweating Efforts, Soaring Passion!', 3, 733);
INSERT INTO `tb_clubs` VALUES (30, '图书馆民管小组', '/clubAvatarUploads/581370566b56f49cc5939e09096038a2', '图书馆民管小组是一个由图书馆用户组成的民间管理团体。我们致力于改善图书馆的管理和服务质量，提升用户体验。通过与图书馆管理部门合作，我们收集用户反馈，提出改进建议，并积极参与图书馆活动的策划与组织。我们的目标是建立一个更加开放、便利、舒适的图书馆环境，满足用户的阅读和学习需求。欢迎对图书馆管理有兴趣的用户加入我们，共同为图书馆的发展贡献力量！', '2014-06-18', '生命科学与工程学院', '5120202238', 72, '/clubAvatarUploads/5b543ba98d6e655459afc34c5be0c87b', '知识共享，文化守望!\\Sharing Knowledge, Guarding Culture!', 2, 3498);
INSERT INTO `tb_clubs` VALUES (31, '悦读社', '/clubAvatarUploads/292fed1f62e890d295cbde74aec94d42', '悦读社是一个致力于推广阅读文化、分享阅读体验的社团。我们致力于营造一个亲切、温馨的阅读环境，为会员提供丰富多彩的阅读活动和交流平台。通过举办读书分享会、文学讲座、书评比赛等活动，我们帮助会员发现更多优秀的图书，促进会员之间的交流与沟通。无论你是喜欢文学、历史、科学还是其他领域的读者，加入我们，让我们一起享受阅读的乐趣，探索知识的海洋！', '2012-03-04', '生命科学与工程学院', '5120202445', 81, '/clubAvatarUploads/526ff40b7c9d68e7b6277944f2587d9f', '字里行间，心灵驻足!\\Between the Lines, Minds at Rest!', 2, 1605);
INSERT INTO `tb_clubs` VALUES (32, 'Douth街舞协会', '/clubAvatarUploads/80706b1fa31b316d6c289d02dba6e1bc', 'Douth街舞协会是一个致力于推广街舞文化、培养舞蹈技能的团体。我们热爱街舞艺术，致力于通过举办舞蹈课程、工作坊、比赛和表演等活动，为会员提供学习、展示和交流的平台。我们欢迎所有对街舞感兴趣的人士，无论你是初学者还是有一定水平的舞者，加入我们，让我们一起跳出青春的活力，释放舞蹈的激情，创造属于我们自己的舞蹈风采！', '2014-11-06', '生命科学与工程学院', '5120202454', 84, '/clubAvatarUploads/6e31d0081c700a428fdd45d5d21a23c3', '节奏飞扬，舞者燃情!\\Rhythms Soar, Dancers Ignite!', 2, 4256);
