INSERT INTO `tb_clubs` VALUES (42, '乒乓球协会', '/clubAvatarUploads/205a31b508ea14ffdf2fd7cf9b15ee7a', '乒乓球协会旨在促进乒乓球运动的发展与普及，为会员提供一个热爱乒乓球、锻炼身体的平台。我们组织各种乒乓球活动，包括练习、比赛、教学等，旨在提升会员的球技水平，培养团队合作和个人技能。无论是初学者还是有一定水平的球员，加入我们，一起享受乒乓球带来的乐趣，挥洒汗水，展示技艺！', '2011-11-18', '体育学科部', '5120204487', 73, '/clubAvatarUploads/9c47a6873937099b2b09aac93ba4973d', '挥动乒乓激情，共创球场传奇!\\Swing with table-tennis passion, create legends on the court together!', 3, 5909);
