INSERT INTO `tb_clubs` VALUES (44, '集邮协会', '/clubAvatarUploads/95be1fd7b9b0287f3f05e8f57be03bd5', '集邮协会致力于促进集邮文化的传承与交流，为会员提供一个探索世界的窗口。我们组织各种集邮活动，包括邮票展览、交换会、讲座等，旨在丰富会员的集邮知识，拓展视野，增进友谊。无论你是新手还是资深藏家，加入我们，与同好们一起分享邮品的美丽与历史，体验集邮带来的乐趣与收获！', '2014-10-26', '马克思主义学院', '5120202562', 60, '/clubAvatarUploads/e9115b99f87eda14da428fb95970f3a9', '邮票世界，趣味无穷!\\World of Stamps, Endless Fun!', 6, 1872);
