INSERT INTO `tb_clubs` VALUES (48, '家庭教育协会', '/clubAvatarUploads/e3254a6ca615828032d82aabca48f273', '家庭教育协会致力于支持和促进家庭教育的发展与提升。我们通过举办家庭教育讲座、家长培训、家庭活动等方式，为家长提供有效的教育方法和家庭管理技巧，帮助他们更好地教育和引导孩子成长。我们相信，健康和谐的家庭是孩子健康成长的重要保障。加入我们，让我们共同致力于打造温馨和睦的家庭教育环境，为孩子们创造更美好的未来！', '2011-07-06', '马克思主义学院', '5120204179', 86, '/clubAvatarUploads/dc938b3eccac240bc985ebc13234170e', '温暖家庭，培育未来!\\Nurturing Future, Warm Family!', 4, 4002);
INSERT INTO `tb_clubs` VALUES (49, '马克思主义中国化研究会', '/clubAvatarUploads/72738c9edb67075c60ad0e861eab2c97', '马克思主义中国化研究会致力于探讨马克思主义在中国的具体应用和发展。我们通过举办学术研讨会、讲座、读书会等活动，深入研究马克思主义理论与中国实际相结合的路径和方法，促进马克思主义理论在中国的深入理解和推广。我们相信，只有不断丰富和发展马克思主义中国化理论，才能更好地指导中国特色社会主义事业的发展。加入我们，让我们共同努力，为马克思主义中国化事业贡献智慧和力量！', '2015-08-13', '马克思主义学院', '5120204760', 87, '/clubAvatarUploads/65c1d9b5c20210cdd267d5910a91ba2e', '理论探索，时代导航!\\Theoretical Exploration, Era Navigation!', 2, 2655);
