INSERT INTO `tb_clubs` VALUES (55, '大众棋社', '/clubAvatarUploads/9bd87050df66faf3265fd274b019c488', '大众棋社是一个致力于推广各种棋类游戏的组织。我们欢迎所有对棋类游戏感兴趣的人士，无论是围棋、象棋、国际象棋、跳棋、五子棋还是其他类型的棋类游戏，我们都欢迎你的加入！在大众棋社，你可以参加各种棋类比赛、学习交流会、观摩赛事等活动，结识志同道合的棋友，共同探索棋艺的奥秘，享受棋类游戏的乐趣。加入我们，让我们一起在棋盘上留下精彩的一手！', '2011-10-15', '经济管理学院', '5120202090', 86, '/clubAvatarUploads/9e1aac5e15dddd9ad3ace191e0c0d8ff', '棋逢对手，智慧碰撞!\\Encountering opponents, wisdom collides!', 6, 4788);
