INSERT INTO `tb_clubs` VALUES (57, '风云投资协会', '/clubAvatarUploads/3e0286fc790ecaa32931ac2b370b01f8', '风云投资协会是一个致力于促进投资理财知识普及和投资技能提升的组织。我们为会员提供各种投资教育、投资交流和投资实践的机会，包括投资讲座、投资研讨会、投资比赛等活动。在风云投资协会，你可以与投资领域的专家和爱好者们分享经验，学习投资技巧，探索投资机会。加入我们，让我们一起在投资的世界中探寻风云变幻的机会，实现财富增值的目标！', '2012-08-10', '经济管理学院', '5120202358', 78, '/clubAvatarUploads/89c4e577cb88677ed7a517a6db188050', '慧理财，财富增值!\\Wise Investment, Wealth Appreciation!', 1, 632);
