INSERT INTO `tb_clubs` VALUES (59, '经济管理协会', '/clubAvatarUploads/84621eb39053d8e5bb3630f444bdc97a', '经济管理协会致力于促进经济学和管理学领域的学术研究与实践应用。我们为会员提供各种经济管理理论与实践的学习机会，包括经济管理讲座、研讨会、案例分析等活动。在经济管理协会，你可以与经济学家、管理学者和企业家们分享经验，探讨经济管理领域的前沿问题和挑战。加入我们，让我们共同促进经济发展，推动管理创新，为建设美好社会贡献力量！', '2011-01-23', '经济管理学院', '5120202395', 68, '/clubAvatarUploads/aaace7c5c13c6f9acda6e3598252d604', '管理智慧，经济引领!\\Management Wisdom, Economic Leadership!', 1, 4993);
INSERT INTO `tb_clubs` VALUES (60, '就业与创业协会', '/clubAvatarUploads/487f3d106078a37adf46a5589dab4603', '就业与创业协会致力于帮助会员顺利就业和创业，提升就业竞争力和创业能力。我们为会员提供各种就业指导、职业规划、创业培训和资源对接的服务，包括就业讲座、招聘会、创业沙龙等活动。在就业与创业协会，你可以获取最新的职场资讯、职业技能提升和创业创新的机会，与企业家、创业者和职业导师们共同探讨就业与创业的机遇和挑战。加入我们，让我们携手并肩，共同开创职业生涯的新篇章！', '2012-09-22', '经济管理学院', '5120202485', 75, '/clubAvatarUploads/73dd2fc69c667d6ed8651d52120094ee', '搭建平台，引领未来!\\Building Platforms, Leading the Future!', 8, 3294);
INSERT INTO `tb_clubs` VALUES (61, '魔术协会', '/clubAvatarUploads/796d34e43b5d537b7e1f99c7fd4e7f34', '魔术协会致力于推广、传承和创新魔术艺术，为会员提供一个学习、交流和表演的平台。我们组织各种魔术技巧训练、表演赛事、艺术讲座等活动，旨在促进会员的魔术技能提升、艺术创作和舞台表现能力。在魔术协会，你可以与魔术爱好者、专业魔术师和艺术家们分享经验，共同探索魔术的奥秘，共享魔术带来的惊喜和乐趣。加入我们，让我们一起用魔术的魅力，为世界带来更多的神奇与欢乐！', '2012-05-14', '经济管理学院', '5120202487', 55, '/clubAvatarUploads/e22e158de285b2a95fe5a52e79bc111a', '越仔细看，越看不清!\\The Closer You Look, The Less You See!', 6, 5330);
INSERT INTO `tb_clubs` VALUES (62, '社会调研拓展协会', '/clubAvatarUploads/ad42f1726b0e386200b343b8f4b3795a', '社会调研拓展协会致力于开展社会调查与研究，以及拓展社会资源与合作网络。我们组织各种社会调研项目、数据分析讲座、社会拓展活动等，旨在促进会员对社会现象的深入了解和探索，同时拓展社会资源，建立合作伙伴关系。在社会调研拓展协会，你将有机会参与社会调查项目，了解社会动态，同时也可以拓展人脉，建立广泛的社会关系网络。加入我们，让我们共同努力，为社会发展和进步贡献智慧和力量！', '2012-05-13', '经济管理学院', '5120202636', 77, '/clubAvatarUploads/1073a9d1c23a4cee6844bf97d27add45', '深度剖析，洞察社会!\\In-depth Analysis, Insight into Society!', 1, 963);
INSERT INTO `tb_clubs` VALUES (63, '市场营销协会', '/clubAvatarUploads/e3487a0228b45537ec9db81d3da7adcd', '市场营销协会致力于促进市场营销领域的学习、交流和实践。我们组织各种市场营销相关的活动，包括市场营销讲座、案例分析、营销竞赛等，旨在帮助会员掌握市场营销的理论知识和实践技能，提升专业素养和竞争力。在市场营销协会，你可以与行业专家、企业管理者和营销从业者们分享经验，探讨市场趋势和策略，拓展人脉和职业发展机会。加入我们，让我们共同探索市场营销的前沿，共享行业的成果和发展！', '2011-10-14', '经济管理学院', '5120202737', 73, '/clubAvatarUploads/4861d8405611ceb29e3cd2748c81746e', '洞察市场，创意营销!\\Market Insight, Creative Marketing!', 1, 1747);
