INSERT INTO `tb_clubs` VALUES (66, '计算机与人工智能协会', '/clubAvatarUploads/df983f878186acf6e594bc269ec946a2', '计算机与人工智能协会致力于推动计算机科学和人工智能领域的学术研究和应用创新。我们组织各种学术讲座、研讨会、项目竞赛等活动，旨在促进会员对计算机科学和人工智能技术的理解和掌握，同时鼓励会员们积极参与科技创新和实践应用。在计算机与人工智能协会，你可以与行业专家、学术研究者和科技创新者们分享知识、交流经验，共同探索计算机科学和人工智能领域的前沿技术和未来发展方向。加入我们，让我们共同努力，推动科技创新，建设智能未来！', '2015-11-14', '计算机科学与技术学院', '5120205470', 80, '/clubAvatarUploads/6448407d72ae2b25b4facc604ddf677a', '智能引领，科技未来!\\Leading with intelligence, shaping the future of technology!', 5, 5120);
