INSERT INTO `tb_clubs` VALUES (68, '3S协会', '/clubAvatarUploads/496cc2f84cd88db1fd772ca0010e7619', '3S协会致力于服务、支持和分享。我们是一个多元化的社区，致力于为会员提供服务、支持和资源共享的平台。我们组织各种社区服务活动、公益项目、技能培训等，旨在建立团结友爱的社区环境，促进会员之间的交流、合作和共享。在3S协会，你可以找到志同道合的伙伴，共同成长、共享资源、共建美好社区。加入我们，让我们一起为社区的发展和进步贡献自己的力量！', '2013-06-11', '环境与资源学院', '5120203940', 61, '/clubAvatarUploads/2fae86fbc672dc1f56d4c17ee16289e1', '探索科技，创造未来!\\Exploring Science, Creating the Future!', 4, 3718);
INSERT INTO `tb_clubs` VALUES (69, 'i7单车协会', '/clubAvatarUploads/7e5ebfc2bdd892da6d369aea093a7d0c', 'i7单车协会致力于推广骑行文化，提倡健康、环保的出行方式。我们组织各种骑行活动，包括骑行旅行、城市探索、骑行比赛等，旨在促进会员之间的交流、互助和合作，同时倡导绿色出行理念。在i7单车协会，你可以享受骑行的乐趣，结识喜爱骑行的小伙伴，共同探索城市风光和自然景观。加入我们，让我们一起骑行，畅游大自然，感受健康、快乐的生活！', '2015-11-05', '环境与资源学院', '5120204034', 73, '/clubAvatarUploads/cb876dc648fea6121f4eafb79c06fa27', '健康生活，环保出行!\\Healthy Living, Eco-Friendly Travel!', 6, 1576);
INSERT INTO `tb_clubs` VALUES (70, '安全科学协会', '/clubAvatarUploads/bb2ee059eaf00e9266ff3934e430fdce', '安全科学协会致力于促进安全科学领域的学术研究和实践应用。我们组织各种安全科学相关的学术交流、研讨会、培训活动等，旨在促进会员对安全科学理论和技术的理解和掌握，提升安全管理和预防能力。在安全科学协会，你可以与安全专家、研究者和从业者们分享经验，共同探讨安全科学领域的最新进展和挑战。加入我们，让我们共同努力，建设安全、稳定的社会环境，保障人民生命财产安全！', '2013-08-08', '环境与资源学院', '5120204043', 71, '/clubAvatarUploads/fe44be40fba089c39aff6a7bbd0fc0ec', '科技护航，安全第一!\\Technology Safeguards, Safety First!', 5, 3545);
INSERT INTO `tb_clubs` VALUES (71, '地质协会', '/clubAvatarUploads/206358932530115400b509a10627b9d2', '地质协会致力于推动地质科学的发展与应用，促进地质资源的合理利用和环境保护。我们组织各种地质学术交流、实地考察、科研项目等活动，旨在加强会员对地质学理论和实践的学习和探索，培养地质科学人才。在地质协会，你可以与地质学者、研究人员和业界从业者们共同探讨地质学领域的热点问题和前沿技术，参与地质调查和资源勘探工作，为地球科学的发展贡献自己的力量。加入我们，让我们一起探索地球的奥秘，保护地球的资源，建设美丽家园！', '2010-10-25', '环境与资源学院', '5120204083', 66, '/clubAvatarUploads/b827146df4156b16366ab5a4650a24fc', '探索大地，解码地球!\\Exploring the Earth, Decoding the Planet!', 1, 1444);
INSERT INTO `tb_clubs` VALUES (72, '苍宇天文协会', '/clubAvatarUploads/12e53a09a1609f546865ebc4cc4f74e8', '苍宇天文协会致力于推广天文科学知识，促进天文爱好者之间的交流与合作。我们组织各种天文观测活动、天文讲座、星空拍摄等，旨在增进会员对天文学的了解，提升观测技能和科学素养。在苍宇天文协会，你可以与热爱天文学的朋友们分享观测经验，探索宇宙的奥秘，共同感受星空之美。加入我们，让我们一起领略宇宙的壮丽景观，探索未知的星辰世界！', '2011-07-05', '国防科技学院', '5120201533', 77, '/clubAvatarUploads/7fe5fddcb04ec5edf7a092a6f5f8da33', '星空奇观，宇宙探索!\\Celestial Wonders, Exploring the Universe!', 1, 2290);
INSERT INTO `tb_clubs` VALUES (73, '节能减排协会', '/clubAvatarUploads/88c42030148f2f115ae91ab841d29b93', '节能减排协会致力于推动节能减排理念的普及和实践，为可持续发展做出贡献。我们组织各种节能减排宣传活动、环保讲座、实地考察等，旨在提高社会对节能减排重要性的认识，促进节能减排技术的应用和推广。在节能减排协会，你可以与环保专家、社会志愿者们共同参与环保行动，共享环保经验，为改善环境、保护地球家园贡献自己的力量。加入我们，让我们共同努力，建设美丽的环境，实现绿色发展目标！', '2013-10-11', '国防科技学院', '5120201842', 80, '/clubAvatarUploads/05f4191c7f842705a148cfcf4be56e6c', '绿色生活，减少碳足迹!\\Green Living, Reducing Carbon Footprint!', 1, 1609);
INSERT INTO `tb_clubs` VALUES (74, '军工文化协会', '/clubAvatarUploads/a67429a83469bb265970b8ecfc196946', '军工文化协会致力于弘扬军工文化，促进军工科技与文化的交流与传承。我们组织各种军工文化活动、军工历史讲座、参观交流等，旨在弘扬军工精神，传承军工文化，推动军工科技发展。加入我们，让我们共同探索军工文化的魅力，传承军工精神！', '2011-01-04', '国防科技学院', '5120201860', 74, '/clubAvatarUploads/f58db4bbfd8ffc5de27109f1b2ac71f9', '传承荣光，强军之道!\\Inheriting Glory, Path to a Strong Military!', 1, 1033);
