INSERT INTO `tb_clubs` VALUES (80, '法学会', '/clubAvatarUploads/392e62f4a4cbf17d8d1a591de57821cd', '法学会致力于推动法学研究与学术交流，促进法治精神的传承与发展。我们组织各种法学讲座、法律实践指导、法律论坛等活动，旨在加深会员对法律知识的理解，提升法律素养和专业能力。加入我们，让我们共同探讨法学的魅力，为法治建设贡献智慧和力量！', '2013-11-30', '法学院', '5120201786', 81, '/clubAvatarUploads/f2d3d5656ad00ec36e46a275f9bcaf3d', '法律是正义天平的砝码!\\Only law is the weight of the balace of justice!', 1, 1957);
